INSERT INTO `user` VALUES ('1', 'caozongchao', 'L6s_Xr0q9MP46v5nn1TrOMR_L5kEBkuZ', '$2y$13$ZmmBNWDISZNYP4VAL5YRCehp7hETLBd/UI63a9BMCLTPBNbcKOhra', null, 'caozongchao@163.com', '10', '1478853252', '1478853252');
INSERT INTO `view` VALUES ('1', '八达岭长城', '2', '2', '5', '<p>中国长城的一段。位于北京市延庆县西南部。八达岭地处居庸关关沟北口 ，地势高峻险要，具有重要的战略地位，八达岭长城修筑得格外坚固。其关城有东西两座关门，东门额题“居庸外镇”，西门额题“北门锁钥”，建于明弘治十八年（1505），嘉靖、万历年间曾加以修葺。两门均为砖石结构 ，券洞上为平台，台之南北各有通道，连接关城城墙。京张公路从城门中通过，为通向北京的咽喉。从北门锁钥城楼左右两侧，长城沿山脊延伸，依山而筑。城墙高低不一，平均高度约7.5米，墙的下宽约6.5米，顶上宽约5.8米。可容五马并骑，或士兵十人并行。城墙下为条石台基，上部为巨砖墙壳，内部填以黄土和碎石。墙顶地面铺砌方砖，顶部内侧为宇墙，外侧为垛墙 ，垛墙上有垛口（望口）和射洞，用以镃望和射击敌人。</p><p>城墙上每隔 30～40 米或100～200米，于险要处筑一堡垒式堡台。堡台建筑于山脊的高处、城墙的转角处或险要之地。堡台有高有低。高的叫作敌楼，上层有垛口可以镃望射击，下层有券洞、射口可以住宿、射击 、屯储火药和粮食。低的为墙台，高度与城墙差不多，但突出于墙外，四周有垛口，是巡逻放哨的地方，原来上面还有房屋建筑用于士兵休息，现仅存地基。</p><p>在八达岭城墙向外眺望，远处还有零散的烟墩，上筑垛口 ，是守卫八达岭长城的警戒设施 。出北门锁钥关门不远，有明隆庆五年（1571）筑成的一座砖城，名岔道城，是八达岭前哨指挥处所在，可驻军 800 余人，并可储备大量的军械于此。八达岭长城在明代盛极一时，到清代后就失去其防御的历史作用，不再修葺。经多年风雨侵蚀和人为破坏而日渐荒芜。1949年以后曾多次整修八达岭关城、关门及南北各4个敌台。1978年又重建了居庸关外镇的城楼。八达岭居庸关，翠岭重叠，花木葱茏，早有居庸叠翠之称，古代燕京八景之一，是闻名中外的旅游胜地。</p>', 'uploads\\2016\\11\\16\\2016111682040.jpg', 'uploads\\2016\\11\\16\\2016111625529.jpg');
INSERT INTO `view` VALUES ('2', '颐和园', '2', '2', '5', '<p>颐和园是中国现存规模最大、保存最完整的皇家园林，中国四大名园（另三座为承德避暑山庄、苏州拙政园、苏州留园）之一。原是清朝帝王的行宫和花园，前身清漪园，为三山五园（三山是指万寿山、香山和玉泉山。三座山上分别建有三园清漪园、静宜园、静明园，此外还有附近的畅春园和圆明园，统称五园）中最后兴建的一座园林。</p><p>颐和园位于北京西北部，占地290余公顷，与西山、玉泉山群峰山水相连，互为衬托。颐和园是乾隆皇帝1750年为其母祝寿而修建的皇家林园，原名清漪园，1860年被英法联军野蛮焚毁。1866年慈禧贪图享乐，挪用海军经费重建，后改名颐和园。<br></p>', 'uploads\\2016\\11\\16\\2016111663280.jpg', 'uploads\\2016\\11\\16\\2016111639182.jpg');
INSERT INTO `view_detail` VALUES ('2', '东宫门', '即正门,靠近西苑。进门即是仁寿殿、德和园。', '2');
INSERT INTO `view_detail` VALUES ('3', '仁寿殿', '仁寿殿，清漪园时名勤政殿，始建于清乾隆十五年（1750），咸丰十年（1860）被英法联军烧毁，光绪十二年（1886）重建，取《论语》中“仁者寿”之意，改名仁寿殿。这里是慈禧和光绪住园期间临朝理政，接受恭贺和接见外国使节的地方，是颐和园听政区的主要建筑。', '2');
INSERT INTO `view_detail` VALUES ('4', '德和园', '德和园在颐和园东宫门内。仁寿殿向北即是德和园，原为清乾隆时（1736-1795）怡春堂旧址。光绪时（1875-1908）改建，其主要建筑为大戏楼、颐乐殿和庆善堂，是慈禧观戏的场所。大戏楼始建于一八九一年，一八九五年建成，舞台宽17米，高21米，上下三层，后台化妆楼二层。顶板上有七个\"天井\"，地板中具有\"地井\"。舞台底部有水井和五个方池。演神鬼戏时，可从\"天\"而降，亦可从\"地\"而出，还可以引水上台。', '2');
INSERT INTO `view_detail` VALUES ('5', '文昌院', '文昌院坐落于颐和园内气势磅礴的文昌阁东墙外，这里原为光绪皇帝的御膳房，民国后渐渐荒芜。为进一步挖掘颐和园的文化内涵，1998年在这里修建了国内目前规模最大、展品最丰、品级最高、设备最先进的古典皇家园林文物博物馆――文昌院。这座园中有园、四合院式的仿古建筑，院中所有的殿宇、匾额、影壁、游廊、画栋雕梁以及门口一雄一雌两具铜狮，无不承袭明清风格，以求与颐和园其他建筑风格统一，其造型和气势，俨然是皇家园林中一处尘封已久的精彩殿堂。 ', '2');
INSERT INTO `view_detail` VALUES ('6', '玉澜堂', '玉澜堂在颐和园昆明湖畔。清乾隆十五年（1750年）建，光绪年间（1875－1908）重建。是光绪帝的寝宫。光绪二十四年（1898年）戊戌变法失败后，慈禧曾幽禁光绪于此。', '2');
INSERT INTO `view_detail` VALUES ('7', '宜芸馆', '宜芸馆在颐和园玉澜堂后。建于清乾隆年间（1736-1795），光绪时（1875-1908）重修。是光绪帝的隆裕皇后在园中的住处。宜芸馆始建于乾隆年间，1860年被烧毁，光绪年间重建。《续博物志》：“芸香辟纸鱼蠹，故藏书台称芸台。”芸是一种香草，可以防书中蛀虫，宜芸馆原是藏书之处，所以有这名称。按照宫廷制度，皇帝与皇后并不同居一室。光绪在选皇后时，本来并未看中隆裕，而是被慈禧逼婚包办的。隆裕少才，容貌也很一般，光绪与她的感情并不融洽。光绪是慈禧的外甥，隆裕则是慈禧的侄女。在光绪与慈禧发生冲突时，隆裕一直紧跟慈禧。光绪被囚，隆裕仍自由自在地当皇后。1908年10月光绪病故，第二天慈禧也死去。慈禧临死前指定由醇亲王载沣之子溥仪继位。隆裕成为皇太后。三年之后，“辛亥革命”成功，由隆裕下了逊位诏书，从此结束了清朝200多年的统治，也结束了中国的封建王朝。两年后隆裕死去，时年46岁', '2');
INSERT INTO `view_detail` VALUES ('8', '乐寿堂', '乐寿堂，清漪园建筑，也是颐和园居住生活区中的主建筑。北京颐和园内慈禧的寝宫乐寿堂，原为乾隆十五年(公元1750年)时本是乾隆的母亲孝圣宪皇后要过六十岁生日，乾隆为了给母亲庆祝六十大寿，在乾隆十四年的时候就把原来的瓮山和西湖加以改造。', '2');
INSERT INTO `view_detail` VALUES ('9', '长廊', '颐和园长廊在万寿山南麓和昆明湖北岸之间。始建于清代乾隆十五年（1750），1860年被英法联军焚毁后，于1888年又重新建造。长廊东起邀月门，西至石丈亭，中间穿过排云门，两侧对称点缀着留佳、寄澜、秋水、清遥四座重檐八角攒尖亭。象征春夏秋冬四季。全长728米，共273间,有548根柱子。长廊以其精美的建筑、曲折多变和极丰富的彩画而负盛名，是我国古建筑和园林中最长的廊。长廊还是一条五光十色的画廊，廊间的每根枋梁上都绘有彩画，共14000余幅，色彩鲜明，富丽堂皇，它的长度和丰富的彩画在1990年就被收入了《吉尼斯世界纪录大全》。彩画的内容多为山水、花鸟图以及中国古典四大名著（《红楼梦》、《西游记》、《三国演义》、《水浒传》）中的情节。画师们将中华数千年的历史文化浓缩在这长长的廊子上。其中许多风景画仿自江南山水，是画师们根据乾隆意图绘制的地方。', '2');
INSERT INTO `view_detail` VALUES ('10', '排云殿', '排云殿位于颐和园万寿山前建筑的中心部位，原是乾隆为其母后60寿辰而建的大报恩延寿寺，慈禧重建的时候更名为排云殿。“排云”二字取自晋代郭璞《游仙诗》：“神仙排云山，但见金银台”。这组建筑是颐和园最为壮观的建筑群。', '2');
INSERT INTO `view_detail` VALUES ('11', '佛香阁', '北京的佛香阁是一座宏伟的塔式宗教建筑，为全颐和园建筑布局的中心。\"佛香\"二字来源于佛教对佛的歌颂。该阁仿杭州的六和塔建造，兴建在20米的石造台基上，八面三层四重檐。高约40米（10.225+7.555+5.975+12.660=36.415米），内有八根铁梨木大柱，直贯顶部，下有20米高的石台基。阁上层榜曰 “式延风教”，中层榜曰“气象昭回”，下层榜曰“云外天香”，阁名 “佛香阁”。内供接引佛，每月望朔，慈禧在此烧香礼佛。', '2');
INSERT INTO `view_detail` VALUES ('12', '石舫', '北京颐和园石舫(如图)又名清晏舫，位于昆明湖的西北部，万寿山的西麓岸边。建于清乾隆二十年（1755年）。船体乃用巨石雕成，全长36米。船上二层白色木结构楼房，都用油漆装饰成大理石纹样，顶部有砖雕装饰，精巧华丽，是颐和园内著名的水上建筑珍品。\r\n舫上舱楼原为古建筑形式，但在英法联军入侵时，舫上的中式舱楼被焚毁。光绪十九年（1893年），按慈禧意图，将原来的中式舱楼改建成西式舱楼，窗上镶嵌五色玻璃，是园中唯一具有西洋风格的建筑。并取河清晏之义，取名清晏舫。', '2');
INSERT INTO `view_detail` VALUES ('13', '耕织图景区', '颐和园耕织图景区位于颐和园西北部，是一座占地25公顷的大型博物馆式园林景区。颐和园耕织图是由耕织图（包括延赏斋、织染局、蚕神庙、耕织图石碑）、水村居，以及水乡田园式的环境组成，曾是清漪园的重要组成部分。颐和园的前身清漪园始建于1750年，是世界文化遗产，是清代皇家园林中保存最完成的一座大型自然山水园。颐和园耕织图景区环境整治及恢复是以保持颐和园皇家园林总体风格为前提，使颐和园的文化内涵更加完整。该项目获2004年度优秀勘查设计一等奖。\r\n颐和园耕织图景区始建于清王朝鼎盛的乾隆时期，当时乾隆皇帝特意将宫廷内务府织染局迁到园内，是体现中国传统“男耕女织”思想的一处独具匠心的绝妙佳景。1860年，英法联军焚毁了当时的“三山五园”，耕织图景区也一同遭到了毁灭性的破坏，致使景区内建筑无存，只留下一块乾隆皇帝御笔亲题的“耕织图”石碑。1886年，慈禧以恢复昆明湖水操的名义，动用当时的海军经费，在耕织图景区的废墟上兴建了水操学堂，使此处又成为了专门培养满族海军人才的高等学府。', '2');
INSERT INTO `view_detail` VALUES ('14', '如意门', '', '2');
INSERT INTO `view_detail` VALUES ('15', '南湖岛', '南湖岛位于北京市颐和园的昆明湖东南侧，昆明湖西堤以东、万寿山以南的湖水之中，占地一公顷多。南湖岛与万寿山遥相呼应，起着丰富水面景物的重要作用。慈禧太后为了显示她对海军操练的关心及统帅清兵的最高权威，于1889年令李鸿章将北洋水师官兵和水师学堂陆战队新毕业的学员共计三千多人调来这里。他们把小小的昆明湖比作“汪洋大”，用小火轮作“战舰”，布阵于湖东水域，而在西堤等处则设有陆军马队等，慈禧坐于南湖岛岚翠间的“阅兵台”上，四周旌旗招展，好不热闹、气派。 表演开始时，一批批“舰队”从东向西驶去，随后水兵们做各种水上及潜水表演等，而陆军马队则行进活跃于西堤等处。“海陆两军”摇旗呐喊，礼炮齐鸣，欢呼“慈禧太后万寿无疆！万寿无疆！”从而以博得“老佛爷”的欢心。', '2');
INSERT INTO `view_detail` VALUES ('16', '十七孔桥', '颐和园俗称“皇家园林博物馆”，其中最大的一座桥就是十七孔桥。整个园林以万寿山和昆明湖为主，昆明湖占了大半面积，湖中有一座小岛（南湖岛），连接昆明湖东岸和南湖岛的这座石桥，就是十七孔桥，它不仅是通往南湖岛的唯一道路，其本身也是一座值得品味与鉴赏的奇特建筑。十七孔桥长达150米，有8米宽，造型美观、气势恢宏，昆明湖宽广的水面碧波荡漾，若没有了十七孔桥的装点，倒显得太单调乏味了，有了这一座横跨水面的石桥，显得更富有生机和情趣。在阳光的照射下，桥与水中的倒影紧密相连，形态优美，似一把长弓。\r\n十七孔桥顾名思义，有十七个孔洞，据说之所以选中十七个孔来建造，是因为从左右两侧数到正中间最大的那个孔洞都为“九”个孔洞，而“九”，恰恰是当时帝王认为最吉利的数字。十七孔桥是清乾隆十七仿“卢沟桥”所建成的，桥上的石雕精美生动，桥的两头各有两只水兽，两侧的栏杆上还有各式各样的石狮子，数来共有544只，比卢沟桥还多上不少。这些石狮子大小不一、姿势千奇百怪，仿佛真的一样。与石狮子照相呼应的是立于桥东面的一尊镇水铜牛，听名字我们就可以猜到是用来镇压水灾、祈求百姓平安的。', '2');
INSERT INTO `view_detail` VALUES ('17', '铜牛', '颐和园铜牛坐落在廓如亭北面的堤岸上，当年乾隆皇帝将其点缀于此是希望它能“永镇悠水”，长久地降服洪水，给园林及附近百姓带来无尽的祥福。为了阐述建造铜牛的意义，乾隆皇帝特意撰写了一首四言的铭文，用篆字书体镌刻在铜牛的腹背上。铜牛是颐和园昆明湖东岸边一道独特的人文景观和艺术珍品。', '2');
INSERT INTO `view_detail` VALUES ('18', '新建宫门', '', '2');
INSERT INTO `view_detail` VALUES ('19', '北宫门', '', '2');
INSERT INTO `view_detail` VALUES ('20', '苏州街', '颐和园苏州街位于北京的西北郊，是后湖两岸仿江南水镇而建的买卖街，乾隆时仿江南水乡的风貌而建，是专供清代帝后逛市游览的的一条水街。乾隆皇帝第一次巡幸江南时，因留恋江南苏州热闹的街肆铺面及物产风俗，命随行画师绘具图式，将其仿建在京城西北郊的皇家园囿内。时年，北京有三处著名的皇家买卖街市，一是圆明园同乐园买卖街;二是清漪园后河买卖街;三是从现在北京动物园西面的万寿寺开始，一直延伸到畅春园（北京大学西面）宫门的“苏州街”，此街专为乾隆皇帝母亲纽钻禄氏70大寿建造，是最大的一条买卖街。上述三条铺面街市巾，属清漪园买卖街最具特色。', '2');
INSERT INTO `view_detail` VALUES ('21', '四大部洲', '颐和园四大部洲是根据古印度哲学观念进行建造的。它是颐和园万寿山后山中部的一组汉藏建筑群，占地2万平方米。四大部洲和八小部洲排列在象征世界中心弥勒山的香岩宗印之阁的周围四方向。在阁的东南、西南、东北、西北建设有代表佛经“四智”的红、白、黑、绿四座喇嘛塔。四大部洲与承德避暑山庄外八庙之一：普宁寺的四大部洲用了同一图纸，因此一模一样。', '2');
INSERT INTO `view_detail` VALUES ('22', '昆明湖东堤', '东堤在颐和园昆明湖东岸。北端为文昌阁，南端为绣漪桥。乾隆时修建。原为畅春园西堤，瓮山泊整修扩建后，加高加厚，改成石堤。因在昆明湖西仿苏堤修建了西堤，这里就改名为东堤。', '2');
INSERT INTO `view_detail` VALUES ('23', '澹宁堂', '澹宁堂位于苏州街东中御路北侧的山脚下，始建于乾隆年间，是一组深长而封闭的建筑群。乾隆12岁时跟随祖父康熙在畅春园居住，康熙皇帝赐给他一处书屋名澹宁居，澹宁堂即是仿澹宁居修建的一处书斋。澹宁二字取意于《诸葛亮.诫子书》中“非澹泊无以明志，非宁静无以致远”一句。澹宁堂南北2进院落，依山势南高北低，北面为2层，南面为1层，南北落差4米余。北院三面是2层的楼阁，一面是叠落廊和敞厅，高低错落，富于变化。澹宁堂南距中御路不足3米，澹宁堂北抱厦突出于后溪河的水面，同时兼顾水陆和高度都不同的外部环境，处理的极为巧妙。澹宁堂咸丰十年（1860年）毁于英法联军，今复建。游览澹宁堂当然首选院内，除了地面仰观，也可以登上二层俯视，两者之间的感觉殊异。观赏澹宁堂的第二个妙处，是在澹宁堂北抱厦面临的后溪河一带，这里春天山桃灿如烟霞，夏天荷花映日盛开，秋天柳条染黄洒金，冬天天地洁白无瑕，一年四季时有胜景。最后特别提醒您别忘了，游览澹宁堂还有一个十分重要的项目是看颐和园藏明清宫廷家具珍品陈列，所以这里是一个等级极高的中国古典家具博物馆。近距离走近明清宫廷硬木（紫檀、黄花梨）家具原物，实属难得，放弃的话实在可惜了。', '2');
INSERT INTO `view_detail` VALUES ('24', '谐趣园', '谐趣园位于颐和园的东北角，由于它小巧玲珑，在颐和园中自成一局，故有“园中之园”之称。谐趣园中共有桥五座，其中以知鱼桥最为著名。这座小园是清乾隆时仿无锡惠山脚下的寄畅园建造，原名惠山园。建成后，乾隆曾写《惠山园八景诗》，在诗序中说：“一亭一径足谐奇趣”。嘉庆时重修改名“谐趣园”。竣工时，嘉庆在《谐趣园记》中说：“以物外之静趣，谐寸田之中和，故名谐趣，乃寄畅之意也。”地仅数亩的小园，趣味究在何处，略举一二。谐趣园在万寿山东麓，是一个独立成区、具有南方园林风格的园中之园。清漪园时名叫惠山园”，是仿无锡惠山寄畅园而建。嘉庆十六年（1811年）重修后，取“以物外之静趣，谐寸田之中和”和乾隆皇帝的诗句“一亭一径，足谐奇趣”的意思，改名为“谐趣园”。园内共有亭、台、堂、榭十三处，并用百间游廊和五座形式不同的桥相沟通。园内东南角有一石桥，桥头石坊上有乾隆题写的“知鱼桥”三字额，是引用了庄子和惠子在“秋水濠上”的争论而来的。', '2');
INSERT INTO `way` VALUES ('1', '由南往北游览，有花费', '1', '在南索道下站乘索道到南四楼，由南往北游玩，到北八楼（最高点），乘坐北索道下来');
